ATTRIBUTE.VALUE:
DELETE FROM  GROSS_MARGIN_STYLE_ACCOUNT 
WHERE GROSS_MARGIN_STYLE_ACCOUNT.SLBA_DIVISION_CODE IN( 'MX','GT','PA', 'SV','CR') 
and GROSS_MARGIN_STYLE_ACCOUNT.update_userid='ETL Rollup From GM'  AND    
(    (   GROSS_MARGIN_STYLE_ACCOUNT.fiscal_year = $$FISCAL_YEAR     
            and    GROSS_MARGIN_STYLE_ACCOUNT.fiscal_period = $$FISCAL_PERIOD                 
         )         
       or
       (    GROSS_MARGIN_STYLE_ACCOUNT.fiscal_year = $$PRIOR_PD_YEAR          
             and 
             GROSS_MARGIN_STYLE_ACCOUNT.fiscal_period = $$PRIOR_PERIOD
        )
);
